"use strict";

function f_gold(nums, operations) {
    let d = {};
    for (let i = 0; i < nums.length; i++) {
        d[nums[i]] = i;
    }
    for (let i = 0; i < operations.length; i++) {
        let a = operations[i][0];
        let b = operations[i][1];
        let idx = d[a];
        delete d[a];
        d[b] = idx;
    }
    let ans = new Array(nums.length).fill(0);
    for (let v in d) {
        ans[d[v]] = parseInt(v);
    }
    return ans;
}
